import React from 'react';
// import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import Header from './Header';
import TaskList from './TaskList';
import * as Lists from './todoListData';

export default class App extends React.Component {

    render() {

        const taskLists = []; // array of components

        // create list of components of data from each list
        for (const key in Lists) {
            taskLists.push(<TaskList data={Lists[key].data} title={Lists[key].name} />);
        }

        return (
            <div>
                <Header />
                <div className="bkgrnd">
                    {taskLists}
                </div>
            </div>
        )
    }
}
